# For details about the SMANet Protocol see
# download.sma.de/smaprosa/dateien/1995/SMADAT-12-ZD0803.pdf
# Example:
# 7e ff 03 40 41 00 00 f1 ff 00 00 0b 0f 09 00 1f 50 7e
# Start-Byte: 7E
# Adress-byte: FF
# Controlfield: 03
# Protokollkopf: 40 41 (40 41 = SMA DATA Telegramme)
# Inhalt: 00 00 f1 ff 00 00 0b 0f 09 00
# FCS (check sequence): 1f 50 
# Stopp-Byte: 7E
# 
# example content: f1 ff 00 00 40 00 06
# f1 ff = source address
# 00 00 = destination address
# 40 = Control : bit 7 adressierungsart: 0= network, 1 = group
#                bit 6 ackn: 0=request, 1=response
# 00 = Packet count
# 06 = CMD
